mongoose.updateOne() always updating the first document<p>I'm making a command for a discord bot in which I want to edit user's info in document. The command looks like this <code>!edit @tag email language</code> this works however it doesnt matter who I ping it will always change the first document in MongoDB.</p>
<pre class="lang-js prettyprint-override"><code>let user = message.mentions.users.first()

Data.findOne({
     userID: user.id,
}, (err, data) =&gt; {
    if (err) return console.log(err);

    if (!data) {
         return message.reply(&quot;That user isn't in list&quot;)
    } else {
         Data.updateOne({
             language: args[2],
             email: args[1]
         }, (err) =&gt; {
             if (err) throw err;
             let embed = new Discord.MessageEmbed()
                    .addField(&quot;Name&quot;, data.name);
                message.channel.send(embed)
            })
        }
</code></pre>
<p>Data.js</p>
<pre class="lang-js prettyprint-override"><code>const mongoose = require(&quot;mongoose&quot;);

const dataSchema = mongoose.Schema({
    name: String,
    language: String,
    email: String,
    userID: String,
    lb: String,
    usage: Number
})

module.exports = mongoose.model(`Data`, dataSchema)
</code></pre>
<p>This is how my documents look like</p>
<p><a href="https://i.stack.imgur.com/ilswx.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/ilswx.png" alt="This is how my documents look like" /></a></p>

