How to update MongoDB field using value of another field<p>Is it possible to update a field using the value of another field?</p>

<p>Here is my schema</p>

<pre><code>var timeSchema = new mongoose.Schema({
    hours: Number,
    minutes: Number
});

module.exports = mongoose.model("Time", timeSchema);
</code></pre>

<p>I want the value of minutes to be hours * 60 when minutes become 0</p>

<p>Here is my code</p>

<pre><code>Time.updateMany({}, {minutes: hours * 60});
</code></pre>

<p>My code throws an <strong>error</strong> which says <code>hours is not defined</code></p>

<p>Is there any possible way to update minutes using the value of hours?</p>

